import "chart.js/auto";
import { Doughnut } from "react-chartjs-2";

const data = {
  labels: ["r", "g", "b"],
  datasets: [
    {
      data: [1, 2, 3],
    },
  ],
};

function Chart() {
  return (
    <div>
      <Doughnut data={data} />
    </div>
  );
}

export default Chart;
